INSERT INTO `articles` VALUES (1,'Atributiile DSU','DEPARTAMENTUL PENTRU SITUAŢII DE URGENŢĂ este structură operaţională fără personalitate juridică a M.A.I, cu atribuţii de coordonare, cu caracter permanent, la nivel naţional, a activităţilor de prevenire şi gestionare a situaţiilor de urgenţă, asigurarea şi coordonarea resurselor umane, materiale, financiare şi de altă natură necesare restabilirii stării de normalitate, inclusiv primul ajutor calificat şi asistenţa medicală de urgenţă în cadrul unităţilor şi compartimentelor de primire a urgenţelor (UPU/CPU).\nDEPARTAMENTUL PENTRU SITUAŢII DE URGENŢĂ coordonează operațional serviciile de ambulanță județene, respectiv al municipiului București, UPU/CPU, precum și serviciile publice Salvamont.\nDepartamentul asigură secretariatul tehnic pentru Comisia Interministerială pentru suport tehnic. CIMST se organizează și funcționează ca organism interministerial, în scopul coordonării activităților privind organizarea, funcționarea și finanțarea Sistemului național de asistență medicală de urgență și de prim ajutor calificat, precum și a serviciilor profesioniste pentru situații de urgență.\nDEPARTAMENTUL PENTRU SITUAŢII DE URGENŢĂ monitorizează activitatea operativă a structurilor pe care le are în coordonare. Condiţiile tehnice şi organizatorice privind coordonarea operaţională a serviciilor publice Salvamont se efectuează în baza protocoalelor încheiate între inspectoratele judeţene pentru situaţii de urgenţă şi autorităţile administraţiei publice locale care au constituite astfel de servicii, avizate de către Departament.','2022-10-21 21:06:45.573000','2022-10-21 21:06:45.573000','2022-10-10 06:38:35.972000',NULL,NULL,'ro'),(2,'Institutii in subordine','Departamentul pentru Situaţii de Urgenţă are în coordonare sau subordonare următoarele instituții:\n\nInspectoratul General pentru Situații de Urgenţă (coordonare)\n\nInspectoratul General de Aviaţie al MAI (coordonare)\n\nDirecția Generală Management Urgențe Medicale (subordonare)\n\nDirecția Medicală (coordonare)\n\nServiciile SALVAMONT (coordonare în colaborare cu autoritățile publice locale)','2022-10-21 21:06:45.598000','2022-10-21 21:06:45.598000','2022-10-10 06:48:23.816000',NULL,NULL,'ro'),(3,'Atributiile DSU2','DEPARTAMENTUL PENTRU SITUAŢII DE URGENŢĂ este structură operaţională fără personalitate juridică a M.A.I, cu atribuţii de coordonare, cu caracter permanent, la nivel naţional, a activităţilor de prevenire şi gestionare a situaţiilor de urgenţă, asigurarea şi coordonarea resurselor umane, materiale, financiare şi de altă natură necesare restabilirii stării de normalitate, inclusiv primul ajutor calificat şi asistenţa medicală de urgenţă în cadrul unităţilor şi compartimentelor de primire a urgenţelor (UPU/CPU).\nDEPARTAMENTUL PENTRU SITUAŢII DE URGENŢĂ coordonează operațional serviciile de ambulanță județene, respectiv al municipiului București, UPU/CPU, precum și serviciile publice Salvamont.\nDepartamentul asigură secretariatul tehnic pentru Comisia Interministerială pentru suport tehnic. CIMST se organizează și funcționează ca organism interministerial, în scopul coordonării activităților privind organizarea, funcționarea și finanțarea Sistemului național de asistență medicală de urgență și de prim ajutor calificat, precum și a serviciilor profesioniste pentru situații de urgență.\nDEPARTAMENTUL PENTRU SITUAŢII DE URGENŢĂ monitorizează activitatea operativă a structurilor pe care le are în coordonare. Condiţiile tehnice şi organizatorice privind coordonarea operaţională a serviciilor publice Salvamont se efectuează în baza protocoalelor încheiate între inspectoratele judeţene pentru situaţii de urgenţă şi autorităţile administraţiei publice locale care au constituite astfel de servicii, avizate de către Departament.','2022-10-21 21:06:45.617000','2022-10-21 21:06:45.617000','2022-10-10 13:49:01.432000',NULL,NULL,'ro'),(4,'The log book saves lives','**Every second counts when it comes to people\'s lives.** Most of the time, precious time is lost in the process of rescuing people trapped in their own cars, especially in the case of serious accidents.\n\nProviding rescue firefighters with the relevant technical information to support them in extrication operations found in the \"on-board rescue book\" (positioning of airbags, fuel tanks, battery, appropriate cut-off points, etc.) will ensure the decrease response time and, at the same time, _increasing the number of people saved by up to 30%_.\n\nMost of the time, precious time is lost in the process of rescuing people trapped in their own cars, especially in the case of serious accidents. Increasing the safety of various car models is a serious challenge for extrication crews. Faced in their battle with pieces of steel and body armor, even the most powerful cutting devices are no longer able to cope. Moreover, certain safety components can represent risk factors both for the intervention crews and for the people waiting to be rescued.','2022-10-21 21:06:45.632000','2022-10-21 21:06:45.632000','2022-10-14 14:42:08.586000',NULL,NULL,'ro'),(7,'IGSU: Missions carried out by rescuers in the last 24 hours','Extinguishing fires, providing first aid, extricating, unlocking or rescuing people and animals from hostile environments are just a few examples of the 1,443 missions carried out by rescuers in the last 24 hours (18.10.2022).\n\nAt the national level, 1,267 people received the help of SMURD crews, the most cases being recorded in the Bucharest-Ilfov area (291 cases), followed by the counties of Cluj (63 cases), Timiș (58 cases) and Mureș (56 cases).\n\nApart from these situations, operative crews intervened to extinguish 48 fires, as well as in 147 other interventions in support of communities.\n\nSpecial attention was also paid to road accidents, with rescue crews acting in 9 situations to extract victims stuck in cars.\n\nAt the same time, during the reference period, during the missions carried out, the military firefighters rescued 5 people in difficulty.\n\nAmong the most relevant missions, we mention:\n\n❗ An intervention that required increased attention from the extrication and first aid crews took place yesterday, in Vrancea county, within the radius of Adjud municipality, DN 2, where military firefighters intervened to manage the aftermath of a road accident between three cars. As a result of the impact, there were three victims, two of whom were incarcerated, in cardio-respiratory arrest. The intervention crews extracted the people stuck in the car and applied resuscitation maneuvers, but to no avail. Our colleagues assisted and medically evaluated the third occupant of the car, who was later transported to the hospital conscious and cooperative.\n\n❗ A complex mission of the military rescuers from the city of Iași took place yesterday when they were asked to intervene in a road accident between a car and a dump truck. Arriving at the place of request, our colleagues found that following the road accident, two victims were incarcerated, one of whom was unconscious in cardio-respiratory arrest. Extrication crews removed the two people from the contorted beasts and SMURD crews applied resuscitation maneuvers. Later, both young people were transported to the hospital for specialized medical assistance.\n\nIn order to cover dynamic missions in the best conditions, 248 rescue firefighters with 159 technical means are at the border with the Republic of Moldova and Ukraine, to manage the influx of people entering the territory of Romania.\n\nIn the future, the rescue firefighters remain mobilized, 24 hours a day, for the operative management of emergency situations and the provision of specialized medical first aid to persons in difficulty.\n\nThe events registered at the national level remain under the attention of the National Operational Center, for the immediate disposition of measures aimed at ensuring the optimization of response missions aimed at saving lives.\n \nDo not forget! Information on how to behave in case of emergency situations can be obtained by accessing the national emergency training platform [https://fiipregatit.ro](link)','2022-10-21 21:06:45.646000','2022-10-21 21:06:45.646000','2022-10-19 09:00:36.830000',NULL,NULL,'ro'),(9,'IGSU: Missions carried out by rescuers in the last 24 hours','IGSU: Missions carried out by rescuers in the last 24 hours\n\nMonday\'s report: 16 people in distress were rescued, and another 1,222 were medically assisted by SMURD crews\n\nYesterday, October 17 this year, was demanding for operative crews from the whole country, the most numerous missions being carried out in the Bucharest-Ilfov area and in the counties of Mureș, Prahova, Constanța and Cluj.\n\nA share of approximately 85% of the total number of interventions consisted in the provision of medical assistance by the SMURD crews (1,206 cases out of a total of 1,435 emergency situations managed).\n\nAlso, rescue firefighters acted to locate and extinguish the 66 fires recorded nationally and promptly managed 159 missions for the protection of communities.\n\nSpecial attention was also paid to road accidents, with rescue crews acting in 4 situations to extract victims stuck in cars.\n\nAt the same time, during the reference period, during the missions carried out, the military firefighters rescued 16 people in difficulty.\n\nIn the last 24 hours, 4 messages warning the population were sent through the RO-ALERT system, 3 of which were messages regarding the presence of wild animals, in the counties of Harghita (2) and Mureș (1); 1 message regarding the disappearance of a minor from home, sent by IGSU, in Bacău county.\n\nAmong the most relevant interventions, we mention:\n\n❗ A complex mission took place yesterday, in Gorj county, Bumbești-Pițic locality, where the military firefighters were requested to intervene to locate and extinguish a fire that broke out at a house. Arriving at the scene, the fire crews found that the flames were manifesting violently, in a building and two annexes on an area of ​​approximately 180 square meters. During the extinguishing mission, a deceased person was found inside the home. Our colleagues extinguished the flames, removing the danger of spreading to neighboring homes.\n\n❗ An intervention that required increased attention and sustained effort took place throughout the day yesterday, in Buzău county, where operative crews acted to extinguish the flames that broke out at three buildings in the town of Siriu. The extinguishing crews that arrived at the scene of the request found that the burning manifested itself with large releases of smoke, in three buildings, on an area of ​​approximately 200 square meters. During the action to extinguish the fire, the SMURD crews evaluated and provided medical assistance to four people, subsequently three of them were transported to the hospital for specialized medical investigations. The flames were extinguished within the limits found.\n\nIn order to cover dynamic missions in the best conditions, 219 rescue firefighters with 160 technical means are at the border with the Republic of Moldova and Ukraine, to manage the influx of people entering the territory of Romania.\n\nThe rescuers remain in duty for the prompt intervention to the requests of the citizens in difficulty, and the dynamics of the events in the field will be carefully monitored by the National Operational Center, for the immediate disposition of the necessary measures to optimize the response missions.\n\nDo not forget! Information on how to behave in case of emergency situations can be obtained by accessing the national emergency training platform [https://fiipregatit.ro](link)','2022-10-21 21:06:45.659000','2022-10-21 21:06:45.659000','2022-10-19 09:34:39.975000',NULL,NULL,'ro');
